import React, {lazy} from 'react';
import {Navigate, useRoutes} from "react-router-dom";
import {ROUTER_URL} from "@shared/config";
import {Loader} from "@shared/ui";
import {AuthGuard, GuestGuard, sessionStore} from "@entities/session";
import {MainLayout} from "@pages/main_layout";

const LoginPage = Loader(lazy(() => import("@pages/login")));
const RegistrationPage = Loader(lazy(() => import("@pages/registration")));
const RecoveryPage = Loader(lazy(() => import("@pages/recovery")));

const ProfilePage = Loader(lazy(() => import("@pages/profile")));
const PersonalPage = Loader(lazy(() => import("@pages/personal")));

const SpacesPage = Loader(lazy(() => import("@pages/spaces")));
const SpacesTaskPage = Loader(lazy(() => import("@pages/spaces_task")));

const SettingsPage = Loader(lazy(() => import("@pages/settings")));
const ChangePasswordPage = Loader(lazy(() => import("@pages/change_password")));

export const Router = () => {
    const isAuth = sessionStore.useSession();

    return useRoutes([
        {
            path: ROUTER_URL.ROOT,
            children: [
                {
                    index: true,
                    element: (
                        <Navigate to={ROUTER_URL.PERSONAL} replace />
                    )
                },

                {
                    path: ROUTER_URL.LOGIN,
                    element: (
                        <GuestGuard isAuth={isAuth}>
                            <LoginPage />
                        </GuestGuard>
                    )
                },
                {
                    path: ROUTER_URL.REGISTRATION,
                    element: (
                        <GuestGuard isAuth={isAuth}>
                            <RegistrationPage />
                        </GuestGuard>
                    )
                },
                {
                    path: ROUTER_URL.RECOVERY,
                    children: [
                        {
                            index: true,
                            element: (
                                <GuestGuard isAuth={isAuth}>
                                    <RecoveryPage />
                                </GuestGuard>
                            )
                        },
                        {
                            path: ":uid/:token",
                            element: (
                                <GuestGuard isAuth={isAuth}>
                                    <RecoveryPage change />
                                </GuestGuard>
                            )
                        },
                        {
                            path: "*",
                            element: <Navigate to={ROUTER_URL.RECOVERY} replace />
                        }
                    ]

                },

                {
                    path: "",
                    element: (
                        <AuthGuard isAuth={isAuth}>
                            <MainLayout />
                        </AuthGuard>
                    ),
                    children: [
                        {
                            path: ROUTER_URL.PROFILE,
                            element: (
                                <ProfilePage />
                            )
                        },
                        {
                            path: ROUTER_URL.PERSONAL,
                            element: (
                                <PersonalPage />
                            )
                        },
                        {
                            path: ROUTER_URL.SPACES.ROOT,
                            children: [
                                {
                                    index: true,
                                    element: (
                                        <SpacesPage />
                                    )
                                },
                                {
                                    path: ":space/task",
                                    element: <SpacesTaskPage />
                                },
                                {
                                    path: ":space/settings",
                                    element: <SpacesTaskPage />
                                }
                            ]
                        },
                        {
                            path: ROUTER_URL.SETTINGS,
                            children: [
                                {
                                    index: true,
                                    element: (
                                        <SettingsPage />
                                    ),
                                },
                                {
                                    path: ROUTER_URL.CHANGE_PASSWORD,
                                    element: (
                                        <ChangePasswordPage />
                                    ),
                                },
                            ]

                        },
                    ]
                }
            ]
        },
        {
            path: ROUTER_URL.ERROR_404,
            element: (<div>Ошибка ебаный в рот</div>)
        },
        {
            path: "*",
            element: <Navigate to={ROUTER_URL.ERROR_404} replace />
        }
    ]);
}
